import React from "react";

function CreateArea() {
  const [newNote, setNewNote] = useState({
    newTitle: "",
    newContent: "",
  });

  function handleChange(event) {}
  return (
    <div>
      <form>
        <input
          onChange={handleChange}
          name="title"
          placeholder="Title"
          value={newNote.newTitle}
        />
        <textarea
          onChange={handleChange}
          name="content"
          placeholder="Take a note..."
          rows="3"
          value={newNote.newContent}
        />
        <button>Add</button>
      </form>
    </div>
  );
}

export default CreateArea;
